import React from 'react';
// import Myapp from './component/input_test';
import { BrowserRouter as Router, Route,Switch} from "react-router-dom";
import Myapp from './component/input_test';
import Picture from './component/test';


function App(){
  return(
    <div>

     <Router>
      <Switch>
        <Route exact path="*">
          <Picture/>
        </Route>
        <Route path="/input_test">
          <Myapp/>
        </Route>
      </Switch>
     </Router>

    </div>

  )
}
export default App;



